import React from 'react'
import '../../css/Categories.css'

export default function Categories() {

    const data = [ 
        {id:1 , type:"Users"},
        {id:2 , type:"Blogs"},
        {id:2 , type:"Blog with Name"},
     ]

  return (
    <>
      <table className="table table-hover">
        <tbody>
            {data.map((data)=>{
                return <tr  key={data.id} >
                <th  scope='row' >
                    <button className='btn btn-dark w-100'>{data.type}</button>
                </th>
            </tr>
            })}
        </tbody>
      </table>
    </>
  )
}
